import React from "react";
import imges from "/.imges";

function Galere() {
  return (
    <div className="galere">
      <h1>My photo collection </h1>
      <div className="top">
        <ul className="tahs">
          <li>all</li>
          <li>mountains </li>
          <li>the sea</li>
          <li>architecture</li>
          <li>the city</li>
        </ul>
      </div>
    </div>
  );
}

export default Galere;
